ic function add_admin_menu() // Admin menu{add_menu_page('FB auto post', 'FB auto post', 'manage_options', 'auto-post-settings', array($this, 'auto_post_dashboard'),'data:image/svg+xml;base64,');}function admin_plugin_style($hook) {wp_register_style( 'custom_css', plugin_dir_url( __FILE__ ) . 'css/style.css' );    wp_enqueue_style( 'custom_css' );	wp_register_style( 'font-awesome', 'https://stackpath.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css' );    wp_enqueue_style( 'font-awesome' );}function raefghribi_add_cron_recurrence_interval( $schedules ) {    $schedules['every_three_minutes'] = array(            'interval'  => 180,            'display'   => __( 'Every 3 Minutes', 'raefghribi-auto-post' )    );      return $schedules;}public static function my_activation() {    if (! wp_next_scheduled ( 'my_cron_event' )) {	wp_schedule_event(time(), 'every_three_minutes', 'my_cron_event');    }}public static function my_deactivation() {	wp_clear_scheduled_hook('my_cron_event');}public static function do_this_cron() {$tz = get_option('autopost_field4')=='' ? 'America/Toronto' : get_option('autopost_field4') ;$cc = new raefghribi_cron_auto_post($tz) ;$cc->setAutoPrograms();}public function register_settings(){    register_setting('my_option_group', 'autopost_field1');	    register_setting('my_option_group', 'autopost_field2');	register_setting('my_option_group', 'autopost_field3');	register_setting('my_option_group_2', 'autopost_field4');    add_settings_section('autopost_section', '', array( $this, 'field1_option'), 'autopost_settings');		add_settings_section('autopost_section_2', '', array( $this, 'field2_option'), 'autopost_settings_2');	add_settings_field('autopost_field1', 'FB App ID :', array( $this, 'form1_html'), 'autopost_settings', 'autopost_section');  	    add_settings_field('autopost_field2', 'FB App Secret Key :', array( $this, 'form2_html'), 'a