);	$wpdb->query("DROP TABLE IF EXISTS {$wpdb->prefix}fb_logs;");	}public function getLastPostsID(){$defaults = array(        'numberposts' => 1,        'category' => 0, 'orderby' => 'date',        'order' => 'DESC', 'include' => array(),        'exclude' => array(), 'meta_key' => '',        'meta_value' =>'', 'post_type' => 'post',        'suppress_filters' => true    );$resultat = get_posts( $defaults );$last_id = $resultat[0]->ID ;$id = $last_id ;global $wpdb;$table = "{$wpdb->prefix}last_done";$data = array('id_last_post_done' => $id);$format = array('%d');$wpdb->insert($table,$data,$format); }function clearLogs(){global $wpdb;$wpdb->query("TRUNCATE TABLE {$wpdb->prefix}fb_logs");wp_redirect(admin_url('admin.php?page=auto-post-settings&tab=logs'));}public function updateLastPostId($id){$table = "{$wpdb->prefix}last_done";$wpdb->update( $table, [ 'id_last_post_done' => $id ], [ '%d' ] );}public static function deletefbpage(){global $wpdb;$table = "{$wpdb->prefix}fb_pages";$wpdb->delete( $table, [ 'page_id' => sanitize_text_field($_POST['page_id']) ], [ '%d' ] );wp_redirect(admin_url('admin.php?page=auto-post-settings&tab=fbpages'));}public static function deletePrgs(){global $wpdb;$table = "{$wpdb->prefix}fb_auto_programs";$wpdb->delete( $table, [ 'id' => sanitize_text_field($_POST['id']) ], [ '%d' ] );wp_redirect(admin_url('admin.php?page=auto-post-settings&tab=programs'));}public function livePrgs(){global $wpdb;$table = "{$wpdb->prefix}fb_auto_programs";$wpdb->update( $table, [ 'live' => $this->getLivePrgs(sanitize_text_field($_POST['id'])) ],['id' => sanitize_text_field($_POST['id'])], [ '%s' ] );wp_redirect(admin_url('admin.php?page=auto-post-settings&tab=programs'));}public static function getLivePrgs($id)	{global $wpdb;$result = $wpdb->get_row("SELECT live from {$wpdb->prefix}fb_auto_programs where id = '$id' Limit 1");$l = $result->live ;if ($l == '1') {$l = '0' ;} else { $l = '1' ;}return $l ;}public function idPagesVSPrograms($id_page){global $wpdb;$num = $wpdb->get_var("SELECT count(*) from {$wpdb->prefix}fb_auto_programs where id_page = '$id_page' ");if ($num == 0) {return false ;} else { return true ;}}public static function getIdAppFromPageTab(){global $wpdb;$result = $wpdb->get_row("SELECT app_id from {$wpdb->prefix}fb_pages Limit 1");$l = $result->app_id ;return $l ;}public static function getLogs(){global $wpdb;$results = $wpdb->get_results( "SELECT * FROM {$wpdb->prefix}fb_logs order by id desc");echo "<table align='center' border='0' cellspacing='0' width='100%'>" ;echo "<tr style='color:#FFF; border-top: 3px solid; border-top-color: #3c8dbc;background-color: #000;'>" ;echo "<td width='15%'><strong>DATE</strong></td>" ;echo "<td width='30%'><strong>".__( 'TITLE', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='30%'><strong>".__( 'LINK', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='20%'><strong>PAGE</strong></td>" ;echo "</tr>" ;$col = '#FFF' ;foreach ( $results as $res ) {if ($col == '#FFF') {$col = '#F5F5F5';} else {$col = '#FFF';}echo "<tr style='background-color:$col;'>";echo "<td>".esc_html($res->datex)."</td>";echo "<td>".esc_html($res->article)."</td>" ;echo "<td>".esc_url($res->lien)."</td>" ;echo "<td>".esc_html($res->page)."</td>" ;echo "</tr>" ;}echo "</table>" ;}public function selectFBPage(){global $wpdb;$results = $wpdb->get_results( "SELECT * FROM {$wpdb->prefix}fb_pages");//return results ;echo "<table align='center' border='0' cellspacing='0' width='80%' style='padding:20px'>" ;echo "<tr style='color:#FFF; border-top: 3px solid; border-top-color: #3c8dbc;background-color: #000;'>" ;echo "<td width='40%'><strong>".__( 'PAGE NAME', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='40%'><strong>".__( 'PAGE ID', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='20%'></td></tr>" ;$col = '#FFF' ;foreach ( $results as $res ) {if ($col == '#FFF') {$col = '#F5F5F5';} else {$col = '#FFF';}echo "<tr style='background-color:$col;'><td>".esc_html($res->name)."</td><td>".esc_html($res->page_id)."</td><td>" ;echo "<form method='post' action='".esc_url( admin_url('admin-post.php') )."'>";echo "<input type='hidden' name='action' value='my_delete_event'>" ;echo "<input type='hidden' name='page_id' value='".esc_html($res->page_id)."'>" ;if ($this->idPagesVSPrograms($res->page_id)) {echo "<button class='btn btn-red' onclick='alert(\"You can not delete it, there is alrady one or more programs with this page\"); return false;'><i class='fa fa-close'></i> Delete</button>" ;} else {echo "<button class='btn btn-red' onclick='return confirm(\"Do you realy want to delete this page?\")'><i class='fa fa-close'></i> Delete</button>" ;}echo "</form>" ;echo "</td></tr>" ;}echo "</table>" ;}public static function fbPageOption(){global $wpdb;$results = $wpdb->get_results( "SELECT * FROM {$wpdb->prefix}fb_pages");echo "<select name='fbpage' required>" ;foreach ( $results as $res ) {	echo "<option value='".esc_html($res->page_id)."'>".esc_html($res->name)."</option>";}echo "</select>" ;}public static function namePageByID($id_page){global $wpdb;$results = $wpdb->get_row( "SELECT name FROM {$wpdb->prefix}fb_pages where page_id = '$id_page' Limit 1");echo  esc_html($results->name) ;}public function selectPrograms(){global $wpdb;$results = $wpdb->get_results( "SELECT * FROM {$wpdb->prefix}fb_auto_programs");//return results ;echo "<table align='center' border='0' cellspacing='0' width='100%' style='padding:20px'>" ;echo "<tr style='color:#FFF; border-top: 3px solid; border-top-color: #3c8dbc;background-color: #000;'>" ;echo "<td width='30%'><strong>".__( 'PAGE NAME', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='15%'><strong>".__( 'LATEST/RANDOM', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='25%' align='center'><strong>CAT</strong></td>" ;echo "<td width='10%' align='center'><strong>".__( 'TIME', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='10%' align='center'><strong>".__( 'NUMBERS', 'raefghribi-auto-post')."</strong></td>" ;echo "<td width='5%'></td><td width='5%'></td></tr>" ;$col = '#FFF' ;foreach ( $results as $res ) {if ($col == '#FFF') {$col = '#F5F5F5';} else {$col = '#FFF';}$cc = ($res->cat != 0) ? get_cat_name($res->cat) : 'All' ;echo "<tr style='background-color:$col;'>" ;echo "<td>";esc_html($this->namePageByID($res->id_page)) ;echo "</td>" ;echo "<td align='center'>".esc_html($res->latest_random)."</td>" ;echo "<td align='center'>".esc_html($cc)."</td>" ;echo "<td align='center'>";echo esc_html(($res->latest_random == 'RANDOM' ? $res->sched : '--' )) ;echo "</td>";echo "<td align='center'>".esc_html($res->nbr)."</td>" ;echo "<td><form method='post' action='".esc_url( admin_url('admin-post.php') )."'>";echo "<input type='hidden' name='action' value='my_live_prgs'>" ;echo "<input type='hidden' name='id' value='".esc_html($res->id)."'>" ;if ($this->getLivePrgs($res->id) != '1') {echo "<button class='btn btn-green'><i class='fa fa-check'></i> Live</button>" ;} else {echo "<button class='btn btn-yellow'><i class='fa fa-times-circle'></i> Pause</button>" ;	}echo "</form>" ;echo "<td><form method='post' action='".esc_url( admin_url('admin-post.php') )."'>";echo "<input type='hidden' name='action' value='my_delete_prgs'>" ;echo "<input type='hidden' name='id' value='".esc_html($res->id)."'>" ;echo "<button class='btn btn-red' onclick='return confirm(\"Do you realy want to delete this program?\")'><i class='fa fa-close'></i> Delete</button>" ;echo "</form>" ;echo "</td>" ;echo "</tr>" ;}echo "</table>" ;}public static function setfbpages(){include("Facebook/autoload.php");$app_id = (get_option('autopost_field1') != null ) ? get_option('autopost_field1') : 'xx';$app_secret = (get_option('autopost_field2') != null) ? get_option('autopost_field2') : 'xx';$fb = new Facebook\Facebook(['app_id' => $app_id,'app_secret' => $app_secret,]);	$helper = $fb->getRedirectLoginHelper();if (isset($_GET['state'])) {$helper->getPersistentDataHandler()->set('state', sanitize_text_field($_GET['state']));}$permissions = ['email']; // Optional permissions$loginUrl = $helper->getLoginUrl(home_url().'/wp-admin/admin.php?page=auto-post-settings&callback=cl', $permissions);echo '<div style="padding:10px;" align="center"><a href="' . esc_url($loginUrl) . '"><Button class="btn btn-fb" type="button"><i class="fa  fa-facebook-square"></i> '.__( 'Get Facebook Pages', 'raefghribi-auto-post').'</Button></a></div>';}public static function the_action_hook_callback(){global $wpdb;$table = "{$wpdb->prefix}fb_auto_programs";$data = array('id_page' => sanitize_text_field($_POST['fbpage']), 'latest_random' => sanitize_text_field($_POST['latest']), 'nbr' => sanitize_text_field($_POST['nbr']), 'live' => '1', 'sched' => sanitize_text_field($_POST['usr_time']), 'cat' => sanitize_text_field($_POST['cat']));$format = array('%s','%s','%d','%s');$wpdb->insert($table,$data,$format); wp_redirect(admin_url('admin.php?page=auto-post-settings'));}public function auto_post_dashboard() // Dashboard page{echo "<div><img src=".esc_url(plugins_url('images/fb-auto-post.png', __FILE__))." /></div>" ;$tabs = array( 'autopost' => 'Auto Post', 'programs' => 'Programs', 'fbpages' => 'FB pages', 'fbappsettings' => 'App Settings','timezone' => 'Time Zone'  ,'logs' => 'Logs');$tabArray = array('autopost','programs','fbpages','fbappsettings','timezone','logs') ;$tab = ( isset ( $_GET['tab'] ) && in_array($_GET['tab'],$tabArray)) ? sanitize_text_field($_GET['tab']) : 'autopost' ;echo '<div id=